CREATE TABLE `product_inventory_incoming` (
  `transaction_id` INTEGER(11) NOT NULL AUTO_INCREMENT,
  `created_at` DATE NOT NULL,
  `vendor_id` SMALLINT(6) DEFAULT NULL,
  `receiver_id` MEDIUMINT(8) DEFAULT NULL,
  `product_id` INTEGER(5) NOT NULL,
  `product_qty` INTEGER(11) NOT NULL,
  `product_unit_id` TINYINT(4) DEFAULT NULL,
  `product_amt` FLOAT(8,2) DEFAULT NULL,
  PRIMARY KEY (`transaction_id`)
)ENGINE=InnoDB
AUTO_INCREMENT=1201 AVG_ROW_LENGTH=76 CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';
COMMIT;



